('1486','15','7364','Finca Stocker',Null,'Hübsche Ferien-Finca mit Panorama Blick in Es Capdella','13955','Dieses gemütliche Ferienhaus im mallorquinischen Fincastil wurde 2004 komplett saniert und mit einer Öl-Zentralheizung ausgestattet. Das Haus steht in Hanglage auf einem 1.500 m² großen Grundstück mit Blick auf den Berg Galatzo und über das idyllische Dorf Es Capdella. Auf der Wohnebene befinden sich ein Wohn-Esszimmer, ein kleines Schlafzimmer (Büroraum), die Küche, das Hauptschlafzimmer mit Bad en suite und ein Gäste WC. Die davorliegende, teilweise überdachte Terrasse, ist umgeben mit einheimischen Pflanzen und Bäumen. Es besteht die Möglichkeit noch ein drittes Schlafzimmer mit Bad einzurichten. Eine Garage und ein Carport stehen zur Verfügung. Außerdem gibt es noch eine 110 m²  große Dachterrasse.','13956','640000','111','2010-10-07 13:57:44','106','2010-10-07 13:58:50',Null,'819','82','419',1,'1','0',Null,Null,Null,'13957',Null,'0','0','0',Null,'2015-06-11 11:12:31',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'13958',Null,'13959',Null,'13960',Null,'13961',Null,'13962','0',0,'0');
